import React from "react";

// reactstrap components
import {
  Button,
  Card,
  CardHeader,
  CardBody,
  CardFooter,
  CardTitle,
  FormGroup,
  Form,
  Input,
  Row,
  Col,
} from "reactstrap";

function User() {
  return (
    <>
      <div className="content">
 <Row>
   <Col md="12">
    <CardHeader>
      <h5 className="title">Insert demographic charts here</h5>
      <p className="category">Created using Montserrat Font Family</p>
      </CardHeader>
   </Col>
 </Row>
      </div>
    </>
  );
}

export default User;
